#include <iostream>
#include <string>
#include <vector>

using namespace std;

struct trie {
    trie *data[26];
    int scroe; // <-- 世界大不同
    trie() : data{nullptr}, scroe{0} {}
};

// others (仲要用recursion 好勁！)
struct Trie {
    int score;
    Trie *children[26];
    Trie() {
        score = 0;
        memset(children, 0, sizeof(children));
    }
    void add(string &s, int i) {
        if (i)
            score++;
        if (i == s.size())
            return;
        if (!children[s[i] - 'a'])
            children[s[i] - 'a'] = new Trie();
        children[s[i] - 'a']->add(s, i + 1);
    }
    int dfs(string &s, int i) {
        if (i == s.size())
            return score;
        return score + children[s[i] - 'a']->dfs(s, i + 1);
    }
};

class Solution {
  public:
    // passed 30/38
    vector<int> sumPrefixScores_TLE(vector<string> &words) {
        vector<int> scroes{};
        vector<trie *> roots(words.size());

        for (size_t i{}; i < words.size(); ++i) {
            trie *cur{roots[i] = new trie{}};
            for (char &c : words[i]) {
                if (cur->data[c - 'a'] == nullptr)
                    cur->data[c - 'a'] = new trie{};
                cur = cur->data[c - 'a'];
            }
        }

        for (size_t i{}; i < words.size(); ++i) {
            int count{};
            for (size_t j{}; j < words[i].size(); ++j) {
                string tmpStr{words[i].substr(0, j + 1)};
                trie *cur;
                for (trie *root : roots) {
                    for (size_t k{}; k < tmpStr.size(); ++k) {
                        if (root->data[tmpStr[k] - 'a'] == nullptr)
                            break;
                        root = root->data[tmpStr[k] - 'a'];
                        if (k == tmpStr.size() - 1)
                            ++count;
                    }
                }
            }
            scroes.push_back(count);
        }

        return scroes;
    }

    // passed 34/38
    vector<int> sumPrefixScores_TLE_again(vector<string> &words) {
        vector<int> scroes{};
        trie *const root{new trie{}};

        for (string &tmpStr : words) {
            trie *cur{root};
            for (char c : tmpStr) {
                if (cur->data[c - 'a'] == nullptr)
                    cur->data[c - 'a'] = new trie{};
                cur = cur->data[c - 'a'];
            }
        }

        for (size_t i{}; i < words.size(); ++i) {
            int count{};
            for (string &word : words) {
                trie *cur{root};
                for (size_t j{}; j < word.size(); ++j) {
                    if (cur->data[word[j] - 'a'] == nullptr ||
                        word[j] != words[i][j])
                        break;
                    cur = cur->data[word[j] - 'a'];
                    ++count;
                }
            }
            scroes.push_back(count);
        }

        return scroes;
    }

    // others
    vector<int> others_sumPrefixScores(vector<string> &words) {
        Trie *trie = new Trie();
        for (string &s : words)
            trie->add(s, 0);
        vector<int> res;
        for (string &s : words)
            res.push_back(trie->dfs(s, 0));
        return res;
    }

    // 參考咗others 嘅code，發現原來buildup trie 時加1 係有咁大威力
    // 我嘅problem solving 能力仲係未到家，而佢狂用recursion 都係我嘅弱項...
    // 以下係我參考佢嘅implementation 再改我原本嘅code 得出嘅成果
    // 簡單咗好多，無咁多loop embedded 埋一齊...
    // 100% passed
    vector<int> sumPrefixScores(vector<string> &words) {
        vector<int> scroes{};
        trie *const root{new trie{}};

        for (string &tmpStr : words) {
            trie *cur{root};
            for (char c : tmpStr) {
                if (cur->data[c - 'a'] == nullptr)
                    cur->data[c - 'a'] = new trie{};
                cur = cur->data[c - 'a'];
                ++cur->scroe; // <-- 呢度重點
            }
        }

        for (string &word : words) {
            trie *cur{root};
            int scroe{};
            for (char c : word) {
                if (cur->data[c - 'a'] == nullptr)
                    break;
                cur = cur->data[c - 'a'];
                scroe += cur->scroe; // <-- 重點again
            }
            scroes.push_back(scroe);
        }
        return scroes;
    }
};

